keypress:
	
	li	$t1, SHIFT_NEXT_ROW
	li	$t2, DISPLAY_FIRST_ADDRESS
	addi	$t2, $t2, SHIFT_NEXT_ROW
	li	$t3, DISPLAY_LAST_ADDRESS
	addi	$t3, $t3, -SHIFT_SHIP_LAST
	addi	$t3, $t3, -SHIFT_NEXT_ROW
	lw	$t0, 4($a1)
	beq	$t0, 0x61, key_a						
	beq	$t0, 0x77, key_w						
	beq	$t0, 0x64, key_d						
	beq	$t0, 0x73, key_s						
	beq	$t0, 0x70, key_p						
	
	key_a:
		
		div	$s0, $t1						
		mfhi	$t9
		addi    $t9, $t9, -8 
		beq	$t9, $zero, keypress_done
				# 
		jal drawCharacterBackground
		jal move_left					#
		b keypress_done
	# go up
	key_w:

		
		div	$s0, $t1						
		mfhi	$t9	

		addi $t0,$s0, 0x90C 
		lw $t6, 0($t0)

		
		bne $t6, 0xccebff, reset_jump_counter
		bge $s1, 1, keypress_done  

		# Jump
		addi $s1, $s1, 1 
		jal drawCharacterBackground
		jal move_up
		b keypress_done

	reset_jump_counter:
		li $s1, 0  # Reset jump counter to 0
		jal drawCharacterBackground
		jal move_up
		b keypress_done
	# go right
	key_d:
		# make sure ship is not in right column
		div	$s0, $t1						
		mfhi	$t9							
		addi	$t1, $t1, -28		#
		beq	$t9, $t1, keypress_done		
		jal drawCharacterBackground
		jal move_right
			# else, move right
		b keypress_done
	# go down
	key_s:
		div	$s0, $t1						# see if ship position is divisible by the width
		mfhi	$t9							# $t9 = $s1 mod $t1 
		addi	$t1, $t1, -36		# need to check if the mod is the row size - 12*4 (width of plane-1)
		beq	$t9, $t1, keypress_done	
			
		jal drawCharacterBackground
		jal move_down
			# else, move right
		b keypress_done
	key_p:
		# restart game
		jal drawGameover
		
		b keypress_done
	keypress_done:
		#jal drawCharacter
		j	main_loop							# jump to ra
