moveObj:
   	addi $sp, $sp, -4
    	sw $ra, 0($sp)
    li $v0, 32
    li $a0, 50   # Wait one second (1000 milliseconds)
    syscall
	jal move_platform1

	jal move_platform2
	jal move_enemy
	jal move_enemy2
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
move_platform1:


    addi $sp, $sp, -4
    sw $ra, 0($sp)
    jal erase_platform1

    lw $t0, move_counter  # Load the move_counter value into $t0
    addi $t0, $t0, 1      # Increment the move_counter by 1
    sw $t0, move_counter  # Store the incremented value back in move_counter

    bgt $t0, 10, move_left1 # If move_counter > 5, move left
    addi $s2, $s2, 4      # Else, move right
    j move_platform1_cont

move_left1:
    addi $s2, $s2, -4      # Move left
    bne $t0, 20, move_platform1_cont  # If move_counter is not 10, continue
    li $t0, 0                       # Reset move_counter to 0
    sw $t0, move_counter

move_platform1_cont:
    jal platform1
    jal drawCharacter
    lw $ra, 0($sp)
    addi $sp, $sp, 4

    jr $ra
####################

move_platform2:


    addi $sp, $sp, -4
    sw $ra, 0($sp)
    jal erase_platform2

    lw $t0, move_counter2 # Load the move_counter value into $t0
    addi $t0, $t0, 1      # Increment the move_counter by 1
    sw $t0, move_counter2 # Store the incremented value back in move_counter

    bgt $t0, 5, move_left2 # If move_counter > 5, move left
    addi $s3, $s3, 4      # Else, move right
    j move_platform1_cont2

