		jal drawCharacter
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		

		
		li $t5, 50  # Load delay loop counter into $t5
		delay_loop:
		nop  # No operation (can be replaced with other instructions if needed)
		addi $t5, $t5, -1  # Decrement delay loop counter
		bnez $t5, delay_loop  # If delay loop counter is not 0, repeat the delay loop
		addi $t4, $t4, -1  # Decrement loop counter
		bnez $t4, move_up_loop  # If loop counter is not 0, repeat the loop
	jr $ra
