    # Check if the character is already at the bottom, then skip the gravity effect
    # Save registers and call drawCharacterBackground to clear the background


    addi $sp, $sp, -4
    sw $ra, 0($sp)
   
    jal drawCharacterBackground
    lw $ra, 0($sp)
    addi $sp, $sp, 4
    # Save registers and call move_down (gravity)
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    jal move_down
